    <div className="container" >
      <Link href="/">
        <a className="h1">First Page</a>
      </Link>
     

      <style jsx>
        {`
        .container{
           background:#ef5359;
           min-height:60px;
           margin:0px;
           display:flex;
           flex-direction:row;
           justify-content:center;

        }
        `}
      </style>
    </div>
  )
}
